import React from "react";

function Idea(props){

function handleClick(event) {
    props.onDelete(props.id)
}

    return (
        <div class="note">
            <h1> {props.title} </h1>
            <p> {props.content}</p>
            <button onClick={handleClick} >DELETE</button>
        </div>
    )
}

export default Idea;
